import Profile from './components/Profile/Profile';
import Header from './components/Header/Header';
import Nav from './components/Nav/Nav';
import './css/style.css';
import Dialogs from './components/Dialogs/Dialogs';
import { Routes, Route, BrowserRouter } from 'react-router-dom';
import News from './components/News/News';
import Music from './components/Music/Music';
import Settings from './components/Settings/Settings';
import Post from './components/Profile/Posts/Post';




const App = () => {

  let postsArr = [
		{ id: 0, message: 'Слова дауна по имени Иван.', name: 'Иван Иванов', age: 23, countLike: 14 },
		{ id: 0, message: 'IDI NHUI LOX.', name: 'GAY DMITROV', age: 5, countLike: 178 },
		{ id: 0, message: 'Да мне похуй', name: 'Сергей Сергеев', age: 31, countLike: 23 }
	]

	let postNew = postsArr.map(p =>
		<Post message={p.message} name={p.name} age={p.age} countLike={p.countLike} />
	);

  let contactArr = [
		{ id: 0, name: "Даун Иваныч" },
		{ id: 1, name: "Даун Лохыч" }
	]

	let contactNew = contactArr.map(c =>
		<Contact id={c.id} name={c.name} />
	);

	let messageArr = [
		{ id: 0, message: "lorem" },
		{ id: 1, message: "Lorem ipsum dolor sit amet." },
		{ id: 3, message: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Modi, nobis mollitia?" }
	]

	let messageNew = messageArr.map(m =>
		<Message id={m.id} message={m.message} />
	);

  return (
    <BrowserRouter>
      <main>
        <div className='app-wrapper'>
          <Header />
          <Nav />
          <div className='content'>
            <Routes>
              <Route path='/profile' element={<Profile usersPosts={postNew}/>}></Route>
              <Route path='/dialogs/*' element={<Dialogs />}></Route>
              <Route path='/news' element={<News />}></Route>
              <Route path='/music' element={<Music />}></Route>
              <Route path='/settings' element={<Settings />}></Route>
            </Routes>
          </div>
        </div>
      </main>
    </BrowserRouter>
  );
}

export default App;
